import React from 'react';
import logo from './logo.svg';
import './App.css';


function App(){
  return (
    <div className="App">
      <header className="App-header">  
          <img src={logo} className="App-logo"/>
      </header>
      <p>
        learn react with arun 
      </p> 
    </div>
  );
}


export default App;
